import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Sidebar from './homepage/Sidebar';
import Homepage from './homepage/Homepage';
class App extends Component {

  componentDidMount(){
    this.getSpacexData();
  }
  getSpacexData(){
    fetch("https://api.spaceXdata.com/v3/launches?limit=10")
      .then(res => res.json())
      .then(
        (result) => {
            console.log(result)
          this.setState({
            isLoaded: true,
            items: result
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

 render(){
  return (
    <div className="App">
      <div className="sideba-main">
        <Sidebar />

      </div>
      <div className="homepage">
          <Homepage />
      </div>

    </div>
  );
 }

}

export default App;
